class Node:
	def __init__(self):
		self.next = [None for _ in range(10)]
		self.name = ''

def buildTrie(root, tup, name):
	for i in tup:
		if not root.next[i]:
			root.next[i] = Node()
		root = root.next[i]
	root.name = name

def searchTrie(root, tup):
	name = ''
	for i in tup:
		if not root.next[i]:
			return 'You cant fool me :P'
		root = root.next[i]
		name = root.name
	return name

