	if v.leader:
		return v.knowledge_count
	visited[v] = True
	for edge in v.edges:
		u = edge.x if edge.y == v else edge.y
		if not visited[u]:
			g[v].add(u)
			dfs(u, g)
	v.knowledge_count = max([v.knowledge] + [dfs(u, g) for u in g[v]])
	return v.knowledge_count

