	for v in g:
		if len(g[v]) == 0:
			v.leader = True
			dfs(v, g)

def find_num_leaders(g):
	leaders = [v for v in g if v.leader]
	leaders.sort(key = lambda x: -x.knowledge_count)
	prev_knowledge_count = -1
	num_leaders = 0
	for v in leaders:
		if v.knowledge_count != prev_knowledge_count:
			num_leaders += 1
			prev_knowledge_count = v.knowledge_count
	return num_leaders

